import React, { Component } from 'react';
import './App.css';
import Graph from './components/graph'
import io from 'socket.io-client'


class App extends Component {

  state = {
      data: [
        {
          name: 'latam',
          price: 100,
          date: 1
        },
        {
          name: 'latam',
          price: 120,
          date: 2
        },
        {
          name: 'latam',
          price: 150,
          date: 3
        }
      ]
  }


  render() {

    console.log(this.state.data)
    return (
      <div className="App">

        <h1> Hello world </h1>

        <Graph data={this.state.data} />
      </div>
      );
    }
}

export default App;
